import {lazy} from "react"
const HomePage = lazy(()=> import("./Home"))

const PrizePage = lazy(()=> import("./Prize"))

export default [
    {
        path:"/",
        exact:true,
        public:true,
        component:HomePage,
    },
    {
        path:"/prize",
        exact:true,
        public:true,
        component:PrizePage,
    }
]
